import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import axios from 'axios';

export function Home() {
  const [backendMessage, setBackendMessage] = useState('');
  const [name, setName] = useState('');
  const [message, setMessage] = useState('');

  const skillsData = [
    { name: 'C++', icon: ' </> ', color: 'text-blue-400', description: 'Strong in object-oriented programming, data structures, and algorithm design.' },
    { name: 'Network', icon: ' ðŸŒ ', color: 'text-green-400', description: 'Good understanding of TCP/IP, DNS, subnetting, and Wireshark analysis.' },
    { name: 'Laravel', icon: ' ðŸ’» ', color: 'text-red-400', description: 'Experience creating REST APIs, Eloquent ORM, Blade templating, and MVC architecture.' },
    { name: 'Python', icon: ' ðŸ ', color: 'text-yellow-400', description: 'Comfortable in scripting, automation, Flask web apps, and data analysis with Pandas.' },
    { name: 'Git', icon: ' ðŸ™ ', color: 'text-orange-400', description: 'Version control, branching strategies, and collaborative GitHub workflows.' },
    { name: 'Database', icon: ' ðŸ—„ï¸ ', color: 'text-purple-400', description: 'Experienced with MySQL queries, joins, and database design principles.' },
  ];

  const portfolioData = [
    {
      id: 'project-1',
      title: 'AMCS (Automated Monitoring & Control System)',
      description: 'An IoT system to monitor and control temperature and humidity using ESP32 and MQTT.',
      techUsed: ['ESP32', 'MQTT', 'Node-RED'],
    },
    {
      id: 'project-2',
      title: 'Car Robotic Obstacle Avoidance',
      description: 'An Arduino-based autonomous car that avoids obstacles using ultrasonic sensors.',
      techUsed: ['Arduino', 'Ultrasonic Sensor', 'Motor Driver'],
    },
  ];

  useEffect(() => {
    axios.get('http://localhost:5000/api/test')
      .then(res => setBackendMessage(res.data.message))
      .catch(err => console.error(err));
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    const mailtoLink = `https://mail.google.com/mail/?view=cm&fs=1&to=your@email.com&su=Portfolio%20Message%20from%20${encodeURIComponent(name)}&body=${encodeURIComponent(message)}`;
    window.open(mailtoLink, '_blank');
  };

  return (
    <section className="relative min-h-screen pt-32 pb-16 px-4 text-center overflow-hidden scroll-smooth bg-black">
      {/* About Me */}
      <motion.div
        initial={{ x: -100, opacity: 0 }}
        animate={{ x: 0, opacity: 1 }}
        transition={{ duration: 1 }}
        className="relative z-10 flex flex-col items-center text-white"
      >
        <motion.div
          initial={{ opacity: 0, scale: 0.95 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.5 }}
          className="relative p-4 rounded-3xl overflow-hidden"
        >
          <img
            src="/your-photo.png"
            alt="Ricarda"
            className="w-48 h-auto object-contain mx-auto drop-shadow-[0_0_15px_rgba(0,204,255,0.7)]"
          />
        </motion.div>
        <h1 id="About me" className="text-3xl font-bold mt-6 mb-4">About Me</h1>
        <p className="text-md max-w-3xl text-gray-300">Hi, Iâ€™m <span className="text-blue-400 font-semibold">Ricarda</span>, an IoT and cybersecurity enthusiast with a creative mindset and passion for robotics and automation.</p>
        <p className="text-blue-300 text-sm mt-4 italic">
          Backend says: <strong>{backendMessage}</strong>
        </p>
      </motion.div>

      {/* Skills */}
      {/* ... Unchanged Skills Section ... */}

      {/* Portfolio */}
      {/* ... Unchanged Portfolio Section ... */}

      {/* Contact & Social */}
      <motion.div
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 1 }}
        viewport={{ once: true }}
        className="relative z-10 mt-32 max-w-3xl mx-auto text-white text-center"
      >
        <h2 id="Contact" className="text-2xl font-bold mb-6">Contact Me</h2>
        <form onSubmit={handleSubmit} className="bg-gray-900 p-6 rounded-xl shadow-lg flex flex-col gap-4">
          <input type="text" placeholder="Your Name" className="p-2 rounded bg-gray-700 text-white" value={name} onChange={(e) => setName(e.target.value)} required />
          <textarea placeholder="Your Message" className="p-2 rounded bg-gray-700 text-white" rows={4} value={message} onChange={(e) => setMessage(e.target.value)} required />
          <button type="submit" className="bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded w-1/3 mx-auto">Send Message</button>
        </form>

        <div className="border border-blue-500 mt-10 rounded-lg p-4 flex justify-around text-white bg-gray-800">
          <a href="https://linkedin.com/in/your-link" target="_blank" rel="noopener noreferrer" className="hover:underline">Linkedin</a>
          <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" className="hover:underline">Github</a>
          <a href="https://instagram.com/yourusername" target="_blank" rel="noopener noreferrer" className="hover:underline">Instagram</a>
        </div>
      </motion.div>
    </section>
  );
}
